import '../css/style.scss';
import React, { FunctionComponent } from 'react';
import { useContext } from 'react';
import UserType from '../../../enums/UserType';
import { createStackNavigator } from '@react-navigation/stack';
import { ServicePage } from '../../../enums/pageEnum';
import { useWeb3React } from '@web3-react/core';
import WalletContext from '../../../contexts/WalletContext';
import Borrow from './apps/Borrow';
import Buy from './apps/Buy';
import Dashboard from './apps/Dashboard';
import Deposit from './apps/Deposit';
import MoneyPool from './apps/MoneyPool';

const Stack = createStackNavigator();
export const Service: FunctionComponent = () => {
  const { userType } = useContext(WalletContext);

  const InitialRouteType = () => {
    switch (userType) {
      case UserType.Borrowers:
        return ServicePage.Borrow;
      case UserType.User:
      case UserType.Collateral:
      case UserType.Guest:
        return ServicePage.Deposit;
      default:
        return ServicePage.Deposit;
    }
  }

  return (
    <Stack.Navigator
      initialRouteName={InitialRouteType()}
    >
      <Stack.Screen
        name={ServicePage.Borrow}
        component={Borrow}
      />
      <Stack.Screen
        name={ServicePage.Buy}
        component={Buy}
      />
      <Stack.Screen
        name={ServicePage.Dashboard}
        component={Dashboard}
      />
      <Stack.Screen
        name={ServicePage.Deposit}
        component={Deposit}
      />
      <Stack.Screen
        name={ServicePage.MoneyPool}
        component={MoneyPool}
      />
    </Stack.Navigator>
  );
}

export default Service;
